var perfectWidgetsPlugin = (function() {

    function _getActuatorDescriptions() {
        return ["Slider1", "Slider2", "Slider3", "Slider4", "Digits1"]
            .filter(name => !!this.getByName(name))
            .map(name => new WidgetActuatorDescription(name, "Current numeric value", WidgetActuatorDescription.READ, WidgetPrototypesManager.SCHEMA_NUMBER));
    }

    // ├────────────────────────────────────────────────────────────────────┤ \\
    // |                      createWidget (public)                         | \\
    // ├────────────────────────────────────────────────────────────────────┤ \\
    function createWidget(idDivContainer, modelJsonIdStr, idInstance, bInteractive) {
        var additionalParams = jQuery.extend(true, {}, modelsParameters[idInstance]);
        additionalParams["interactive"] = bInteractive;
        const widgetObj = new PerfectWidgets.Widget(idDivContainer, models[modelJsonIdStr], additionalParams);
        widgetObj.getActuatorDescriptions = _getActuatorDescriptions;
        // MBG 11/09/2020 center svg for perfect widgets
        var divSvg = document.getElementById(idDivContainer + '_svg');
        divSvg.style.margin = "auto";
        divSvg.style.display = "block";

        return widgetObj;
    }

    // ├────────────────────────────────────────────────────────────────────┤ \\
    // |                       copyWidget (public)                          | \\
    // ├────────────────────────────────────────────────────────────────────┤ \\
    function copyWidget(wcIdStr, modelJsonIdStr, oldWidgetObj, instanceId, bInteractive) {
        var additionalParams = jQuery.extend(true, {}, modelsParameters[instanceId]);
        additionalParams["interactive"] = bInteractive;
        const widgetObj = new PerfectWidgets.Widget(wcIdStr, models[modelJsonIdStr], additionalParams);
        widgetObj.getActuatorDescriptions = _getActuatorDescriptions;
        // MBG 11/09/2020 center svg for perfect widgets
        var divSvg = document.getElementById(wcIdStr + '_svg');
        divSvg.style.margin = "auto";
        divSvg.style.display = "block";
        // A deplacer après à la fin
        if (widgetObj.getByName(widgetConnector.effectiveSliders()[sliderName]) != null) { //getting slider object
            for (var sliderName in widgetConnector.effectiveSliders()) {
                var slider = widgetObj.getByName(widgetConnector.effectiveSliders()[sliderName]);
                if (oldWidgetObj) {
                    var oldSlider = oldWidgetObj.getByName(widgetConnector.effectiveSliders()[sliderName]);
                    var val = oldSlider.getValue();
                    slider.setValue(val);
                }
            }
        }

        //
        return widgetObj;
    }

    // ├────────────────────────────────────────────────────────────────────┤ \\
    // |                         clear (public)                             | \\
    // ├────────────────────────────────────────────────────────────────────┤ \\
    function clear() {}

    // Plugin definition
    var pluginDefinition = {
        'name': 'perfectWidgets',
        'widgetsDefinitionList': {
            perfectWidgetsSimpleMeter: { factory: "perfectWidgetsSimpleMeter", title: "Simple meter", icn: "simple-meter" },
            perfectWidgetsTachometer: { factory: "perfectWidgetsTachometer", title: "Tachometer", icn: "tachometer" },
            perfectWidgetsMultiSwitch: { factory: "perfectWidgetsMultiSwitch", title: "Multi switch", icn: "multi-switch" },
            perfectWidgetsSimpleCompass: { factory: "perfectWidgetsSimpleCompass", title: "Simple compass", icn: "compass" },
            perfectWidgetsSimpleCircleWind: { factory: "perfectWidgetsSimpleCircleWind", title: "Wind circle", icn: "wind-circle" },
            //perfectWidgetsSimpleThermometer: { factory: "perfectWidgetsSimpleThermometer", title: "Simple thermometer", icon: "simpleThermometer.png", iconWidth: 50 }
        },
    };

    // Public interface
    return {
        createWidget,
        copyWidget,
        clear,
        pluginDefinition
    };
}());

